import React, { useState, useEffect } from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import Header from '../sharedpages/header';
import Navbar from '../sharedpages/navbar';
import Footer from '../sharedpages/footer';
import './RespondToFeedback.css';

const RespondToFeedback = () => {
  const [activeTab, setActiveTab] = useState('feedback');
  const [response, setResponse] = useState('');
  const [feedback, setFeedback] = useState(null);
  const location = useLocation();
  const navigate = useNavigate();

  // Mock feedback data - in real app this would come from the location state or API
  const mockFeedback = {
    id: 1,
    user: 'Alex Morgan',
    date: '2024-01-15',
    subject: 'Listing Accuracy',
    message: 'The listing for the property at 123 Oak Street seems to have incorrect square footage. It\'s listed as 2000 sq ft, but it\'s actually closer to 1800 sq ft. Please update the listing to reflect the correct information.',
    rating: 3,
    status: 'In Progress'
  };

  useEffect(() => {
    // In a real app, you'd get feedback data from location state or fetch from API
    // For now, using mock data
    setFeedback(mockFeedback);
  }, []);

  const handleResponseChange = (e) => {
    setResponse(e.target.value);
  };

  const handleSendResponse = () => {
    if (response.trim()) {
      console.log('Sending response:', response);
      console.log('For feedback:', feedback);
      // Add your response logic here
      // After successful response, you might want to navigate back to feedback management
      navigate('/dashboard/feedback-management');
    } else {
      alert('Please enter a response before sending.');
    }
  };

  const handleCancel = () => {
    navigate('/dashboard/feedback-management');
  };

  if (!feedback) {
    return (
      <div className="respond-to-feedback-page">
        <Header />
        <div className="respond-to-feedback-dashboard-container">
          <Navbar activeTab={activeTab} setActiveTab={setActiveTab} />
          <main className="respond-to-feedback-main-content">
            <div className="respond-to-feedback-content-header">
              <h1 className="respond-to-feedback-main-title">Loading...</h1>
            </div>
          </main>
        </div>
        <Footer />
      </div>
    );
  }

  return (
    <div className="respond-to-feedback-page">
      <Header />
      <div className="respond-to-feedback-dashboard-container">
        <Navbar activeTab={activeTab} setActiveTab={setActiveTab} />
        <main className="respond-to-feedback-main-content">
          <div className="respond-to-feedback-content-header">
            <div className="respond-to-feedback-breadcrumb">
              <span className="respond-to-feedback-breadcrumb-item">Feedback Management</span>
              <span className="respond-to-feedback-breadcrumb-separator">/</span>
              <span className="respond-to-feedback-breadcrumb-item">Respond to Feedback</span>
            </div>
            <h1 className="respond-to-feedback-main-title">Respond to Feedback</h1>
          </div>
          
          <div className="respond-to-feedback-content">
            {/* Feedback Details Section */}
            <section className="respond-to-feedback-feedback-details-section">
              <h2 className="respond-to-feedback-section-title">Feedback Details</h2>
              <div className="respond-to-feedback-feedback-info">
                <div className="respond-to-feedback-feedback-item">
                  <label>Feedback from:</label>
                  <span>{feedback.user}</span>
                </div>
                <div className="respond-to-feedback-feedback-item">
                  <label>Date:</label>
                  <span>{feedback.date}</span>
                </div>
                <div className="respond-to-feedback-feedback-item">
                  <label>Subject:</label>
                  <span>{feedback.subject}</span>
                </div>
                <div className="respond-to-feedback-feedback-item">
                  <label>Message:</label>
                  <div className="respond-to-feedback-feedback-message">{feedback.message}</div>
                </div>
              </div>
            </section>

            {/* Response Section */}
            <section className="respond-to-feedback-response-section">
              <h2 className="respond-to-feedback-section-title">Your Response</h2>
              <textarea
                className="respond-to-feedback-response-textarea"
                placeholder="Type your response here..."
                value={response}
                onChange={handleResponseChange}
                rows={8}
              />
            </section>

            {/* Action Buttons */}
            <section className="respond-to-feedback-action-buttons-section">
              <button 
                className="respond-to-feedback-action-btn respond-to-feedback-send-response-btn"
                onClick={handleSendResponse}
                disabled={!response.trim()}
              >
                Send Response
              </button>
              <button 
                className="respond-to-feedback-action-btn respond-to-feedback-cancel-btn"
                onClick={handleCancel}
              >
                Cancel
              </button>
            </section>
          </div>
        </main>
      </div>
      <Footer />
    </div>
  );
};

export default RespondToFeedback;
